initialize();

/********************VIDEO CONTROL********************/
///////////////////////////////////////////////////////
var spaceKeyPressEvent = new KeyboardEvent('keydown',{'keyCode':32,'which':32});
var video_element = $('video').get(0); 
var mediaPlayer = $('.btm-media-player').get(0); 
var findVideo = setInterval(getVideo, 1000);
var videoView = setInterval(videoViewChanged, 500);
var videoWasMini = false;
function getVideo() {
    if (video_element == null) {
        video_element = $('video').get(0);
    } else {
        clearInterval(findVideo);
        log('Video is found');
        
        video_element.onpause = function() {
            if (!isRemote) {
                const data = {
                    id: peer.id,
                    from: $('#chat-username').val(),
                    message: 'paused the video',
                    action: 'pause',
                };
                insertMessage(data, true);
            }
            isRemote = false;
        };
        
        video_element.onplay = function() {
            if (!isRemote) {
                const data = {
                    id: peer.id,
                    from: $('#chat-username').val(),
                    message: 'played the video at ',
                    action: 'play',
                    timestamp: video_element.currentTime,
                };
                let minutes = Math.floor(data.timestamp / 60);   
                let seconds = Math.floor((data.timestamp) - (minutes * 60)); 
                data.message = data.message + minutes + ':' + seconds;
                insertMessage(data, true);
            }
            // isRemote will be reset in onseeking function if this is called from remote data
        };

        video_element.onseeked = function() {
            if (!isRemote) {
                // Send play action if video hasn't paused yet
                // This will automatically sync video
                if (!video_element.paused) {
                    const data = {
                        id: peer.id,
                        from: $('#chat-username').val(),
                        message: 'played the video at ',
                        action: 'play',
                        timestamp: video_element.currentTime,
                    };
                    let minutes = Math.floor(data.timestamp / 60);   
                    let seconds = Math.floor((data.timestamp) - (minutes * 60)); 
                    data.message = data.message + minutes + ':' + seconds;
                    insertMessage(data, true);
                }
            }
            isRemote = false;
        };
    }
}

function handleVideoActions(data) {
    isRemote = true;
    switch (data.action) {
        case 'pause':
            if (!video_element.paused) {
                // send spaceKeyPressEvent to toggle pause
                mediaPlayer.dispatchEvent(spaceKeyPressEvent);
                log('video is sent pause() function');
            } else {
                isRemote = false;
            }
            break;
        case 'play':
            if (video_element.paused) {
                mediaPlayer.dispatchEvent(spaceKeyPressEvent);
            } 
            video_element.currentTime = data.timestamp;
            log('video currentTime is updated');
            log('video is sent play() function');
            break;
    }

    insertMessage(data, false);
}

function videoViewChanged() {
    if ($('#hudson-wrapper').hasClass('video_view--mini')) {
        // Shift classes to keep chat without blocking webpage elements
        $('#hudson-wrapper').removeClass('chat-active');
        $('#hudson-wrapper').removeClass('video-resize');
        $('#webAppRoot').addClass('chat-active');
        videoWasMini = true;
    } else if ($('#hudson-wrapper').hasClass('video_view--hidden') || !location.hash) {
        // Remove extension if video is gone
        $('.dplus').empty();
        $('.dplus').remove();
        clearInterval(videoView);
        window.dispatchEvent(new Event('dplus_removed'));
    } else {
        if (videoWasMini) {
            // Back to normal
            $('#webAppRoot').removeClass('chat-active');
            $('#hudson-wrapper').addClass('chat-active');
            $('#hudson-wrapper').addClass('video-resize');
            videoWasMini = false;
        }
    }
}